DROP TABLE IF EXISTS english_relation;
CREATE TABLE english_relation (type VARCHAR(2) NOT NULL,id_source CHAR(10) NOT NULL,id_target CHAR(10) NOT NULL,w_source VARCHAR(110) NOT NULL,w_target VARCHAR(110) NOT NULL, status varchar(4) NULL, PRIMARY KEY (type, id_source, id_target, w_source, w_target));

